import React from "react";
import styled from "styled-components";

const StyledNavbar = styled.nav`
  background-color: ${({ theme }) => theme.bg};
  display: flex;
  justify-content: space-between;
  align-items: center;
  border-radius: 40px;  // Set the border-radius for rounded edges
  width: 100%;  // Set the desired width
  height: 60px;  // Set the desired height
  gap: 12px;
  padding: 0 6px;

  marginBottom: '20;';
  cursor: 'pointer'

  > div {
    color: "white";

    margin: -9px; /* Change the value according to your preference */
  }
  > div p {
    color: white;   /* Set the font color to white */

  }
`;
const NavItems  = styled.ul`
width: 100%;
display: flex;
align-items: center;
justify-content:center;
gap: 32px;
padding: 0 6px;
list-style: none;

@media screen and (max-width: 768px) {
  display: none;
}
`;

const Navbar = () => {
  return (
    <NavItems>
          <p>About</p>
          <p> Skills</p>
          <p>Experience</p>
          <p>Projects</p>
          <p>Education</p>

        </NavItems>

  )
};


export default Navbar;
